import React, { Component } from "react";

class VillageDetails extends Component {
  state = {};
  render() {
    return (
      <div class="village-details village-basic-wrapper">
        <table class="table">
          <thead>
            <tr>
              <th>State Name</th>
              <th>District NAme</th>
              <th>Block Name</th>
              <th>GP Name</th>
              <th>Village NAme</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>State</td>
              <td>District</td>
              <td>Block</td>
              <td>GP</td>
              <td>Village</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default VillageDetails;
